@mistercrunch I am testing this PR to enhance logging in caravel.  Reference: 

1) http://docs.python-guide.org/en/latest/writing/logging/
2) https://docs.python.org/2/library/logging.config.html

@prihoda Ideally we don't want to see these exceptions on the UI. We should log them on console and show a pop up on the UI. I believe @williaster pushed a similar fix in another PR merged 6 days ago.

https://github.com/airbnb/caravel/commit/92f73b67ca1c6f486961962c796128f38320c3b8
Do you think we can make similar fix for this?
